    protected function setUp(): void
    {
        $this->batchuploadHelper = $this->getMockBuilder(BatchuploadHelper::class)
            ->DisableOriginalConstructor()->setMethods(['getWorkSpaceDeleteDays'])
            ->getMock();
        $this->userworkspaceCollectionFactory = $this->getMockBuilder(UserworkspaceCollectionFactory::class)
            ->DisableOriginalConstructor()
            ->setMethods(['create','addFieldToFilter','getSize','getIterator','getWorkspaceData','save'])
            ->getMock();
        $this->userworkspaceCollectionMock = $this->getMockBuilder(Collection::class)
            ->DisableOriginalConstructor()
            ->setMethods(['addFieldToFilter','getSize', 'getIterator', 'getWorkspaceData', 'getUserworkspaceId','save'])
            ->getMock();
       $this->userworkspaceFactory = $this->getMockBuilder(UserworkspaceFactory::class)
            ->DisableOriginalConstructor()
            ->setMethods(['create','getWorkspaceData','load', 'getUserworkspaceId','save','setWorkspaceData','setOldUploadDate','delete'])
            ->getMock();
        $this->userworkspaceMock = $this->getMockBuilder(Userworkspace::class)
            ->DisableOriginalConstructor()
            ->setMethods(['create','getWorkspaceData', 'load', 'getUserworkspaceId','save','setWorkspaceData','setOldUploadDate','delete'])
            ->getMock();
        $this->loggerMock = $this->createMock(LoggerInterface::class);    
        $objectManagerHelper = new ObjectManager($this);
        $this->deleteWorkSpace = $objectManagerHelper->getObject(
            DeleteWorkSpace::class,
            [
                'batchuploadHelper' => $this->batchuploadHelper,
