    public function testExecute()
    {
        $this->batchuploadHelper->expects($this->any())->method('getWorkSpaceDeleteDays')->willReturn(30);
        $this->userworkspaceCollectionFactory->expects($this->any())->method('create')->willReturn($this->userworkspaceCollectionMock);
        $this->userworkspaceCollectionMock->expects($this->any())->method('addFieldToFilter')->willReturnSelf();
        $this->userworkspaceCollectionMock->expects($this->any())->method('getSize')->willReturn(10);
        $this->userworkspaceCollectionMock->expects($this->any())
        ->method('getIterator') ->willReturn(new \ArrayIterator([$this->userworkspaceCollectionMock])); 
        $this->userworkspaceCollectionMock->expects($this->any())->method('getWorkspaceData')->willReturn(self::WORKSPACEDATA);
        $this->userworkspaceFactory->expects($this->any())->method('create')->willReturn($this->userworkspaceMock);
        $this->userworkspaceMock->expects($this->any())->method('load')->willReturnSelf();
        $this->userworkspaceCollectionMock->expects($this->any())->method('getUserworkspaceId')->willReturn(123);
        $this->userworkspaceCollectionMock->expects($this->any())->method('save')->willReturnSelf();      
        $result = $this->deleteWorkSpace->execute();
        $this->assertEquals(null, $result);
    }

